  [],\n\t\"revision_timestamp\": \"2015-09-26T21:35:49.395342\",\n\t\"name\": \"december-2002-lidar-point-data-of-southern-california-coastline-dana-point-to-point-la-jolla112dd\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains lidar point data
  (latitude and longitude) from a strip of Southern California coastline (including
  water, beach, cliffs, and top of cliffs) from Dana Point to Point La Jolla. The
  data set was created by combining data collected using an Optech Inc. Airborne Laser
  Terrain Mapper (ALTM) 1225 in combination with geodetic quality Global Positioning
  System (GPS) airborne and ground-based receivers. The Bureau of Economic Geology,
  the University of Texas at Austin owns and operates an ALTM 1225 system (serial
  number 99d118). The system was installed in a single engine Cessna 206 (tail number
  N4589U) owned and operated by the Texas State Aircraft Pooling Board. The lidar
  data set described by this document was collected on 3-4 December 2002 (33702 and
  33802) between 20:33 and 23:29 UTC on 33702 and 20:26 and 21:19 UTC on 33802 (see
  Lineage, Source_Information, Source_Contribution for pass information). Conditions
  on both days were clear skies, no fog or low clouds. A second flight on 33802 was
  required due to low cloud formation on 33702. 99d118 instrument settings for this
  flight were; laser pulse rate: 25kHz, scanner rate: 26Hz, scan angle: +/-20deg,
  beam divergence: narrow (wide for offshore pass), altitude: 700-820m AGL, and ground
  speed: 78-112kts. Two GPS base stations (Scripps pier and San Onofre Power Plant,
  see Lineage, Source_Information, Source_Contribution for coordinates) were operating
  during the survey. Data represented is all points including terrain, vegetation,
  and structures. This data also contains returns from the water surface. No processing
  has been done to remove returns from terrain, vegetation, structures or water surfaces.\",\n\t\"license_title\":
